create table tbl_Cases
(
    ID      int auto_increment
        primary key,
    Patient int     null,
    AidType tinyint null,
    Purpose tinyint null,
    Result  tinyint null,
    constraint tbl_Cases_spr_AidType_ID_fk
        foreign key (AidType) references spr_AidType (ID),
    constraint tbl_Cases_spr_Purpose_ID_fk
        foreign key (Purpose) references spr_Purpose (ID),
    constraint tbl_Cases_spr_Result_ID_fk
        foreign key (Result) references spr_Result (ID),
    constraint tbl_Cases_tbl_Patients_ID_fk
        foreign key (Patient) references tbl_Patients (ID)
);

